import React, { useState } from 'react';
import { FaPlus } from 'react-icons/fa';
import './cardreq.scss';

function cardreq(props) {

    return (
        <div className="Card">
            <div style={{paddingTop:'5%',paddingLeft:'5%'}}>
                <h>Name</h>
            </div>
            <div className="Add">
                    <button
                        className="Icon">
                        <i class="fas fa-eye"></i>
                    </button>
                </div>
            {props.name}
        </div>
    );
}

export default cardreq;
